var Crypto=require("crypto");var Boom=require("boom");var internals={};exports.randomString=function(c){var a=exports.randomBits((c+1)*6);if(a instanceof Error){return a}var b=a.toString("base64").replace(/\+/g,"-").replace(/\//g,"_").replace(/\=/g,"");return b.slice(0,c)};exports.randomBits=function(c){if(!c||c<0){return Boom.internal("Invalid random bits count")}var a=Math.ceil(c/8);try{return Crypto.randomBytes(a)}catch(b){return Boom.internal("Failed generating random bits: "+b.message)}};exports.fixedTimeComparison=function(d,c){if(typeof d!=="string"||typeof c!=="string"){return false}var f=(d.length===c.length?0:1);if(f){c=d}for(var g=0,e=d.length;g<e;++g){var h=d.charCodeAt(g);var j=c.charCodeAt(g);f|=(h^j)}return(f===0)};